434 :          *
435 :          * 2. Subtraction
436 :          *    -----------
437 :          * The following cases should be covered
438 :          * (2 * x) - x
439 :          * x - y
440 :          * y - x
441 :          * y - z
442 :          * y - (y - x)
443 :          * (y + x) - y
444 :          *
445 :          * The values to be considered are: x, y, z, x + y, y - x.
446 :          *
447 :          * 3. Multiplication
448 :          *    --------------
449 :          * (x * x) * (1 / x)
450 :          * (1 / x) * (x * x)
451 :          * x * y
452 :          * y * x
453 :          * y * z
454 :          *
455 :          * The values to be considered are: x, y, z, 1 / x, x * x.
456 :          *
457 :          * 4. Division
458 :          *    --------
459 :          * (x * x) / x
460 :          * x / y
461 :          * y / x
462 :          * y / z
463 :          *
464 :          * The values to be considered are: x, y, z, x * x.
465 :          *
466 :          * Also to be considered NaN, POSITIVE_INFINITY, NEGATIVE_INFINITY.
467 :          */
468 :         final double[] values = {x, y, z, 2 * x, -x, 1 / x, x * x, x + y, x - y, y - x};
