470 :         final double[] data2 = new double[values.length * values.length];
471 :         int k = 0;
472 :         for (int i = 0; i < values.length; i++) {
473 :             for (int j = 0; j < values.length; j++) {
474 :                 data1[k] = values[i];
475 :                 data2[k] = values[j];
476 :                 ++k;
477 :             }
478 :         }
